{
    // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = fragCoord/iResolution.xy;
    uv.y -= 1.0;
    uv.y *= -1.0;
    uv.x *= iResolution.x / iResolution.y;

    float x = 0.1;
    float y = 0.3;



    uint a = n7(uv, vec2(x, y), 0.5);
    uint b = n8(uv, vec2(x + 0.15, y), 0.5);
    uint c = n9(uv, vec2(x + 0.3, y), 0.5);
    uint d = Z(uv, vec2(x + 0.45, y), 0.5);
    uint e = n0(uv, vec2(x + 0.6, y), 0.5);
    uint f = n1(uv, vec2(x + 0.75, y), 0.5);
    uint g = n2(uv, vec2(x + 0.9, y), 0.5);
    uint h = n3(uv, vec2(x + 1.05, y), 0.5);
    uint i = n4(uv, vec2(x + 1.2, y), 0.5);
    uint j = n5(uv, vec2(x + 1.35, y), 0.5);
    uint k = n6(uv, vec2(x + 1.5, y), 0.5);




    // Output to screen
    fragColor = vec4(vec3(a + b + c + d + e + f + g + h + i + j + k), 1.0);

}

